export default function ScheduleSessionButton({ onClick }) {
  return (
    <div id="lucas" className="btn-container">
      <a href="#calendly">
    <button onClick={onClick} className="btn-agendar">
      Agendá una sesión
    </button>
    </a>
    </div>
  );
}
